import { Box } from "@material-ui/core";
import React, { useState } from "react";
import Hero from "../Components/Hero";
import Detail from "../Components/Detail/";

const gap = "100px";

function ContactUs() {

    const content =
    {
        hero: {
            heading: "Contact Us",
            page: "Contact Us",
            image: "/assets/image.png"
        },
        title: "I Care a lot",
        type: "Feature Film",
        thumbnail: {
            url: "assets/kemis-yelebesku.png",
        },
        gallery: [

        ],
        descriptions: [
            "This is the first description we have in the content",
            "This is the second description we have in the content",
            "This is the third description we have in the content"
        ],
        projectInfo: {
            client: "Digital Studio",
            date: "19 February 2021",
            director: "J Blakeson",
            actors: [
                "Chris Messina",
                "Michael Malvesti",
                "Kevin McCormick"
            ],
        },
        awards: [
            {
                name: "Gumma Awards",
                category: " Cinematographer of the Year - 2015"
            },
            {
                name: "Gumma Awards",
                category: " Cinematographer of the Year - 2015"
            }
        ]
    }

    return (
        <>
            <Hero {...content.hero} />
            <Box height={gap} />
            <Detail {...content} />


        </>
    );
}

export default ContactUs;
